  gform: {
    width:"100%",
    height:"1379px",
    frameBorder:"0",
    marginHeight:"0",
    marginWidth:"0",
 }
}))

function Form(props) {
  const classes = useStyles();

  useEffect(() => {
    setTimeout(() => {document.getElementById("frame").style.overflowY = "hidden"}, 2000)
  }, []);

  
